sys_variable_value.value:
(function execute(inputs, outputs) {

  var request = {}

  try {
    var key = inputs.key
    var memo = inputs.memo
    var rsr = inputs.rsr
    var sign_with = inputs.sign_with

    if (key.public_key) { request.key = key.getValue("public_key") } 
    if (memo) { request.memo = memo } 
    if (rsr) { request.rsr = rsr }

    if (sign_with) {
      request.sign = []  
      while (sign_with.next()) {
      request.sign.push(sign_with.getValue("public_key"))
      }
    }
  } catch (e) {
    gs.error(e)
    throw("Error while creating request")
  }

  outputs.request = JSON.stringify(request)


})(inputs, outputs);

